import React from "react";
import logoBarra from '../Img/gato-normal.jpg';
import { Outlet, Link } from 'react-router-dom';

import '../Css/Boton-Nav.css';


function BarraNav(props){
  return(
    <div className = 'contenedor'>
      <img
        className = 'imagenBarra'
        src = {logoBarra}
        alt = 'Logo barra nav' />
      <label
        className='BotonCambioPag'>
        <Link to={props.urlDeLaPag1}>Inicio</Link>
      </label>
      <label
        className='BotonCambioPag'>
        <Link to={props.urlDeLaPag2}>Sobre Mi</Link>
      </label>
      <label
        className='BotonCambioPag'>
        <Link to={props.urlDeLaPag3}>Contacto</Link>
      </label>
      <label
        className='BotonCambioPag'>
        <Link to={props.urlDeLaPag4}>Ejemplo 4</Link>
      </label>
      <label
        className='BotonCambioPag'>
        <Link to={props.urlDeLaPag5}>Ejemplo 5</Link>
      </label>
      <Outlet />
    </div>
  );
};

export default BarraNav;
